import React from 'react';

const menuChats = () => {
    return (
        <div>

            <h2>Мои чаты</h2>

            <div className="container-my-chats">

                <div className="block-chat">
                    <div className="info-chat">
                        <p>User 1</p>
                        <span>Online</span>
                    </div>  
                </div>

            </div>
            
        </div>
    );
};

export default menuChats;
